const columns = [
    {
        title: "ID",
        dataIndex: "id",
        key: "id",
        valueType: "text",
    },
    {
        title: "Name",
        dataIndex: "name",
        key: "name",
        valueType: "text",
    },
    {
        title: "Price",
        dataIndex: "price",
        key: "price",
        valueType: "money",
    },
    {
        title: "Amount",
        dataIndex: "amount",
        key: "amount",
        valueType: "digit",
    },
    {
        title: "Option",
        dataIndex: "option",
        key: "option",
        valueType: "option", // Định dạng kiểu option
        render: (_, record) => [
            <a
                key="config"
                onClick={() => {
                    console.log("Configuration clicked for:", record); // Hoặc gọi một hàm
                }}
            >
                Configuration
            </a>,
            <a
                key="subscribe"
                style={{ marginLeft: 8 }}
                onClick={() => {
                    console.log("Subscribe clicked for:", record); // Hoặc gọi một hàm
                }}
            >
                Subscribe to alerts
            </a>,
        ],
    },
];
